import React from 'react'

function ExpensesDate  (props) {
    const year = props.date.getFullYear()
    const month = props.date.toLocalString('sv-SV', {month:'long'})
    const day = props.date.toLocalString('sv-SV', {day:'2-digit'})
  return (
    <div className='expense-date'>
        <div>{year}</div>
        <div>{month}</div>
        <div>{day}</div>
    </div>
  )
}
export default ExpensesDate
